Geht es dir nicht genauso? Die Grenzen in deinem Kopf sagen dir: "𝐈𝐜𝐡 𝐤𝐚𝐧𝐧 𝐝𝐚𝐬 𝐧𝐢𝐜𝐡𝐭". 

❌STOP.  Warum bemitleidest du dich und versuchst es noch nicht einmal? 

Weil es die "anderen" schon gemacht haben und gescheitert sind? Na und, vielleicht sind sie die Extrameile nicht gegangen. Oder sie haben sich selbst manipuliert. 

Gerade am Anfang einer Ernährungsumstellung kommen vielen Mentees oft Zweifel und sie sagen zu mir: Andreas, ich kann das einfach nicht. Ich werde es nie schaffen, 10, 20 oder gar 30 kg abzunehmen. 

Es gibt 3 Möglichkeiten darauf zu reagieren: 
1. Unterwerfe dich deinem Zustand und hör auf zu erwarten, dass sich etwas positiv verändert. 
2. Nimm die Herausforderung an und tue was dagegen - die Chance, dass du dein Ziel 
erreichst steigt rapide an. 
3. Akzeptiere deine Vergangenheit, lerne die Spielregeln und arbeite jetzt an deiner Zukunft. 

Also hör endlich auf dich selbst zu bemitleiden und tue was dagegen. Sag doch einfach zu dir selbst: Ich kann das 𝐍𝐎𝐂𝐇 nicht! 
Fühlt sich doch gleich ganz anders an, dein Unterbewusstsein suggeriert dir direkt, dass du ins Handeln kommen sollst und wird sehen, es passiert etwas mit dir. 

Und wenn du möchtest, zeige ich dir, wie du es schaffst. Ganz simple, Schritt für Schritt wirst du deinen Bauch los. Für Immer!

Worauf wartest du noch, manipulierst du dich noch selbst oder bist du bereits etwas zu ändern? Für welche der 3 Möglichkeiten entscheidest du dich?

Ich wünsche dir ein schönes Wochenende, 
dein Andreas
