Do you wake up every day and step on the scale to make sure you’re exactly within 1-2lbs of your “goal weight”?

OR

Do you avoid the scale altogether because you know it disrupts your mental health?

⭐️

We know firsthand why scales can often SUCK 🤮 For starters WATCH THE VIDEO 📹👆🏼 #swipe That is the SAME body, SAME person, SAME day, only seconds apart.

One scale is a standard bathroom scale, the other is one our #amazonfavorites {link in bio}, a small travel-sized scale. The numbers that appear are 1lb off exactly... so which number 🔢 are you going to use to define your worth? If you’re building muscle 💪🏼 you may secretly admire the higher number. If you’re looking to lose fat mass you are probably eyeing up the lighter number.

🚨 But wait... 

WHY ARE YOU LETTING A NUMBER DEFINE YOUR WORTH?? 😭🤷🏼‍♀️

The scale is one measuring tool we, as coaches, use to assess progress, but this tool is trivial in comparison to all of the other techniques and biofeedback measures we collect.

When we post a picture of our clients’ transformations are we highlighting their scale weight achievements... or are we showing you how BEAUTIFULLY their body is adapting and changing based on the progress they have made with MVP Fit Squad??

What a scale can’t measure and what pictures can’t illustrate are the mindset shifts around food, body image, exercise, eating out, parties, relationships and more that have developed and flourished during the course of the program. Those are the measurements WE VALUE 💕🌟

So next time you step on the scale remember there are so many other reasons besides fat mass that influence the number flashing back at you! Heck it could just be the craftsmanship of the d@mn scale! 😂🤦🏼‍♀️

